首先，在 lib 下创建一个名为 fib 的新目录： mkdir src/lib/fib 现在，你可以在 src/lib/fib 下创建新文件： a.mbt: pub fn fib(n : Int) -> Int { match n { 0 => 0 1 => 1 _ => fib(n - 1) + fib(n - 2) }
} b.mbt: pub fn fib2(num : Int) -> Int { fn aux(n, acc1, acc2) { match n { 0 => acc1 1 => acc2 _ => aux(n - 1, acc2, acc1 + acc2) } } aux(num, 0, 1)
} moon.pkg.json: {} 在创建完这些文件后，你的目录结构应该如下所示： my-project
├── LICENSE
├── README.md
├── moon.mod.json
└── src ├── lib │ ├── fib │ │ ├── a.mbt │ │ ├── b.mbt │ │ └── moon.pkg.json │ ├── hello.mbt │ ├── hello_test.mbt │ └── moon.pkg.json └── main ├── main.mbt └── moon.pkg.json 在 src/main/moon.pkg.json 文件中，导入 username/hello/lib/fib 包，并自定义别名为 my_awesome_fibonacci： { "is_main": true, "import": [ "username/hello/lib", { "path": "username/hello/lib/fib", "alias": "my_awesome_fibonacci" } ]
} 这行导入了 username/hello/lib/fib 包。导入后，你可以在 main/main.mbt 中使用 fib 包了。 将 main/main.mbt 的文件内容替换为： fn main { let a = @my_awesome_fibonacci.fib(10) let b = @my_awesome_fibonacci.fib2(11) println("fib(10) = \{a}, fib(11) = \{b}") println(@lib.hello())
} 为了执行程序，需要在 moon run 命令中指定 username/hello/main 包的文件系统路径： $ moon run ./src/main
